/*Table structure for table `pay_order` */

DROP TABLE IF EXISTS `pay_order`;

CREATE TABLE `pay_order` (
  `order_id` bigint(20) NOT NULL COMMENT '订单ID',
  `channel` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '充值渠道',
  `user_name` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '下单小号',
  `password` varchar(80) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '下单小号密码',
  `goods_url` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '商品URL',
  `platform_order_no` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '平台订单号(99平台订单号)',
  `client_order_no` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '国美订单号',
  `amount` varchar(35) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '订单金额(单位:分)',
  `pay_url` varchar(300) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '支付订单url',
  `client_order_status` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '客户端订单状态(0:成功, 1:商品库存不足, 2:小号下单次数达到上限, 9:未知状态<其实返回的是空字符串>)',
  `status` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '订单状态(0:支付连接生成成功, 1:支付成功(收到回调), 2:支付连接生成失败)',
  `receiving_goods_status` char(1) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '收货状态(0:未收货, 1:确认收货)',
  `pay_type` varchar(1) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '支付方式:(0:支付宝, 1:支付宝WAP, 2:微信扫一扫, 3:微信H5, 5:QQ, 6:QQWAP, 7:京东, 8:京东WAP, 9:银联快捷, 10:银联快捷WAP, 11:银联网关, 12:银联扫码, 13:苏宁支付)',
  `notify_url` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '下游回调地址',
  `notify_send_notify_count` int(11) NOT NULL COMMENT '发送回调次数',
  `sign` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '加签字符串',
  `return_result` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '返回结果(0:fail, 1:success)',
  `create_time` datetime NOT NULL COMMENT '订单创建时间',
  `pay_time` datetime DEFAULT NULL COMMENT '订单支付时间',
  `receiving_goods_time` datetime DEFAULT NULL COMMENT '确认收货时间',
  PRIMARY KEY (`order_id`),
  KEY `platform_order_no` (`platform_order_no`),
  KEY `client_order_no` (`client_order_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='订单表';

